  }
}

Additionally, there is an imperative API which is sometimes simpler.
import React from 'react';
import Animation from 'lottie-react-native';

export default class BasicExample extends React.Component {
  componentDidMount() {
    this.animation.play();
  }

  render() {
    return (
       { this.animation = animation; }}
        style={{
          width: 200,
          height: 200,
        }}
        source={require('../path/to/animation.json')}
      />
    );
  }
}

Sample App
You can check out the example project with the following instructions

Clone the repo: git clone https://github.com/airbnb/lottie-react-native.git
Open: cd lottie-react-native and Install: npm install
Run npm start to start the packager.
In another CLI window, do the following:

